import React from 'react';
import Button from '../Button/Button';
import './FirmFactCard.scss';

interface FirmFactCardProps {
  variant: 'default' | 'border';
  buttonText: string;
  icon: boolean;
  isTwoLine: boolean;
}

const FirmFactCard: React.FC<FirmFactCardProps> = ({ variant, buttonText, icon, isTwoLine }) => {
  return (
    <div className={`firmFactCard ${variant}`}>
      <div className="card-content">
        <Button text={buttonText} icon={icon} isTwoLine={isTwoLine} />
        hover
      </div>
    </div>
  );
};

export default FirmFactCard;
